import React from 'react';
import './App.css';


const App =()=>{
  return(
      <div>
          <Header/>
        <h1>Hello world!</h1>
      </div>
  )

}

export default App;
const Header = ()=>{
    return(
        <div>
            <nav>
                <ul>
                    <li>Home</li>
                    <li>Message</li>
                    <li>News</li>
                    <li>Settings</li>
                </ul>
            </nav>
        </div>
    )
}
